CREATE TABLE IF NOT EXISTS VUELOS
(
    ID                  INTEGER,
    SALIDA              TIMESTAMP,
    DESDE               VARCHAR(100),
    LLEGADA             TIMESTAMP,
    HASTA               VARCHAR(100),
    PRECIO              NUMERIC,
    DESCUENTO           NUMERIC,
    CONSTRAINT PK_VUELOS PRIMARY KEY (ID)
);





UPDATE VUELOS
SET SALIDA = SALIDA + INTERVAL '12 month', LLEGADA = LLEGADA + INTERVAL '12 month';



